import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Title() {
    return (
        <div className='title'>
            The Title
        </div>
    )
}

function App() {
    return(
        <div>
            <div className='book'>
                <Title/>
                <div className='author'>
                    The Author
                </div>
                <ul className='stats'>
                    <li className='rating'>
                        5 start
                    </li>
                    <li className='isbn'>
                        12-34576374
                    </li>
                </ul>
                </div>
        </div>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'));
